import React, { Component } from 'react';
import PropTypes from 'prop-types'
import "../App.css"

class TodoSubList extends Component {

    render() {
        return this.props.todosublist.map((input) => {
            <div className="item1-container">
                input.task
            </div>
        })

    }

}


TodoSubList.propTypes = {
    todosublist: PropTypes.array.isRequired
}
export default TodoSubList;
